            _.Display(WABEND.LOCALIZA_ABEND_1.PARAGRAFO);

            /*" -2305- READ MOV-SIGAT AT END */
            try
            {
                MOV_SIGAT.Read(() =>
                {

                    /*" -2307- MOVE 'FIM' TO W-FIM-MOVTO-SIGAT */
                    _.Move("FIM", WAREA_AUXILIAR.W_FIM_MOVTO_SIGAT);

                    /*" -2309- GO TO R0050-SAIDA. */
                    /*Método Suprimido por falta de linha ou apenas EXIT nome: R0050_SAIDA*/ //GOTO
                    return;
                });

                _.Move(MOV_SIGAT.Value, REG_SIGAT);

            }
            catch (GoToException ex)
            {
                return;
            }
            /*" -2311- IF W-FIM-MOVTO-SIGAT NOT EQUAL 'FIM' */

            if (WAREA_AUXILIAR.W_FIM_MOVTO_SIGAT != "FIM")
            {

                /*" -2312- DISPLAY '    LIDO: ' REG-SIGAT */
                _.Display($"    LIDO: {REG_SIGAT}");

