                        /*" -2326- MOVE REG-SIGAT TO REG-HEADER W-REG-HEADER */
                        _.Move(MOV_SIGAT?.Value, LXFPF990.REG_HEADER, W_REG_HEADER);

                        /*" -2330- IF (RH-TIPO-ARQUIVO OF REG-HEADER EQUAL 1 AND RH-NOME OF REG-HEADER EQUAL 'PRPSASSE' ) OR (RH-TIPO-ARQUIVO OF REG-HEADER EQUAL 0 AND RH-NOME OF REG-HEADER EQUAL 'SEGINFDB' ) */

                        if ((LXFPF990.REG_HEADER.RH_TIPO_ARQUIVO == 1 && LXFPF990.REG_HEADER.RH_NOME == "PRPSASSE") || (LXFPF990.REG_HEADER.RH_TIPO_ARQUIVO == 0 && LXFPF990.REG_HEADER.RH_NOME == "SEGINFDB"))
