                            /*" -2332- END-IF */
                        }


                        /*" -2333- GO TO R0050-00-LER-MOV-SIGAT */
                        new Task(() => R0050_00_LER_MOV_SIGAT_SECTION()).RunSynchronously(); //GOTO
                        return;//Recursividade detectada, cuidado...

                        /*" -2334- ELSE */
                    }
                    else
                    {


                        /*" -2335- IF REG-TIPO-SIGAT EQUAL 'T' */

                        if (REG_SIGAT.REG_TIPO_SIGAT == "T")
                        {

                            /*" -2336- MOVE REG-SIGAT TO REG-TRAILLER */
                            _.Move(MOV_SIGAT?.Value, LBFPF991.REG_TRAILLER);

                            /*" -2339- IF RH-TIPO-ARQUIVO OF REG-HEADER EQUAL 1 OR 0 NEXT SENTENCE */

                            if (LXFPF990.REG_HEADER.RH_TIPO_ARQUIVO.In("1", "0"))
