                                /*" -2340- ELSE */
                            }
                            else
                            {


                                /*" -2341- GO TO R0050-00-LER-MOV-SIGAT */
                                new Task(() => R0050_00_LER_MOV_SIGAT_SECTION()).RunSynchronously(); //GOTO
                                return;//Recursividade detectada, cuidado...

                                /*" -2345- ELSE */
                            }

                        }
                        else
                        {


                            /*" -2346- IF WS-NOME-HEADER EQUAL 'SEGINFDB' */

                            if (WAREA_AUXILIAR.WS_NOME_HEADER == "SEGINFDB")
                            {

                                /*" -2348- IF ( REG-SIGAT(02:7) EQUAL '0008471' OR REG-SIGAT(02:7) EQUAL '0008472' ) */

                                if ((REG_SIGAT.Substring(02, 7) == "0008471" || REG_SIGAT.Substring(02, 7) == "0008472"))
                                {

                                    /*" -2349- GO TO R0050-00-LER-MOV-SIGAT */
                                    new Task(() => R0050_00_LER_MOV_SIGAT_SECTION()).RunSynchronously(); //GOTO
                                    return;//Recursividade detectada, cuidado...

                                    /*" -2350- END-IF */
                                }


                                /*" -2353- END-IF */
                            }


                            /*" -2362- IF REG-NOME-ARQUIVO(6:2) = 50 OR 71 OR 72 OR 96 OR 97 OR 98 OR REG-NUM-PROPOSTA = 00084694639010 OR 00084694652416 OR 00084694666786 OR 00084694669181 OR 00084694670562 OR 00084694675467 */

                            if (REG_SIGAT.FILLER_0.REG_NOME_ARQUIVO.Substring(6, 2).In("50", "71", "72", "96", "97", "98") || REG_SIGAT.REG_NUM_PROPOSTA.In("00084694639010", "00084694652416", "00084694666786", "00084694669181", "00084694670562", "00084694675467"))
                            {

                                /*" -2363- EVALUATE REG-NOME-ARQUIVO(6:2) */
                                switch (REG_SIGAT.FILLER_0.REG_NOME_ARQUIVO.Substring(6, 2).Value.Trim())
                                {

                                    /*" -2364- WHEN '50' */
                                    case "50":

                                        /*" -2365- ADD 1 TO WS-PRODUTO50 */
                                        WAREA_AUXILIAR.WS_PRODUTO50.Value = WAREA_AUXILIAR.WS_PRODUTO50 + 1;

                                        /*" -2366- WHEN '71' */
                                        break;
                                    case "71":

                                        /*" -2367- ADD 1 TO WS-PRODUTO71 */
                                        WAREA_AUXILIAR.WS_PRODUTO71.Value = WAREA_AUXILIAR.WS_PRODUTO71 + 1;

                                        /*" -2368- WHEN '72' */
                                        break;
                                    case "72":

                                        /*" -2369- ADD 1 TO WS-PRODUTO72 */
                                        WAREA_AUXILIAR.WS_PRODUTO72.Value = WAREA_AUXILIAR.WS_PRODUTO72 + 1;

                                        /*" -2370- WHEN '96' */
                                        break;
                                    case "96":

                                        /*" -2371- ADD 1 TO WS-PRODUTO96 */
                                        WAREA_AUXILIAR.WS_PRODUTO96.Value = WAREA_AUXILIAR.WS_PRODUTO96 + 1;

                                        /*" -2372- WHEN '97' */
                                        break;
                                    case "97":

                                        /*" -2373- ADD 1 TO WS-PRODUTO97 */
                                        WAREA_AUXILIAR.WS_PRODUTO97.Value = WAREA_AUXILIAR.WS_PRODUTO97 + 1;

                                        /*" -2374- WHEN '98' */
                                        break;
                                    case "98":

                                        /*" -2375- ADD 1 TO WS-PRODUTO98 */
                                        WAREA_AUXILIAR.WS_PRODUTO98.Value = WAREA_AUXILIAR.WS_PRODUTO98 + 1;

                                        /*" -2376- END-EVALUATE */
                                        break;
                                }


                                /*" -2380- IF REG-SIGAT(1:1) EQUAL 3 AND REG-SIGAT(16:4) NOT EQUAL 0050 AND 0071 AND 0072 AND 0096 AND 0097 AND 0098 */

                                if (REG_SIGAT.Substring(1, 1) == 3 && !REG_SIGAT.Substring(16, 4).In("0050", "0071", "0072", "0096", "0097", "0098"))
                                {

                                    /*" -2383- MOVE ZEROS TO WSQLCODE WSQLERRD1 WSQLERRD2 */
