                                    /*" -2384- MOVE SPACES TO WSQLERRMC */
                                    _.Move("", WABEND.WSQLERRO.WSQLERRMC);

                                    /*" -2388- DISPLAY 'R0050 - PRODUTO DIFERENTE DE 50 ' ', 71 , 72 , 96 , 97  E  98' ' PRODUTO = ' REG-SIGAT(16:4) ' NUM-PROPOSTA ' REG-NUM-PROPOSTA */

                                    $"R0050 - PRODUTO DIFERENTE DE 50 , 71 , 72 , 96 , 97  E  98 PRODUTO = REG-SIGAT(16:4) NUM-PROPOSTA {REG_SIGAT.REG_NUM_PROPOSTA}"
                                    .Display();

                                    /*" -2389- GO TO R0050-00-LER-MOV-SIGAT */
                                    new Task(() => R0050_00_LER_MOV_SIGAT_SECTION()).RunSynchronously(); //GOTO
                                    return;//Recursividade detectada, cuidado...

                                    /*" -2390- END-IF */
                                }


                                /*" -2391- GO TO R0050-00-LER-MOV-SIGAT */
                                new Task(() => R0050_00_LER_MOV_SIGAT_SECTION()).RunSynchronously(); //GOTO
                                return;//Recursividade detectada, cuidado...

                                /*" -2393- END-IF */
                            }


                            /*" -2394- IF RH-TIPO-ARQUIVO OF REG-HEADER EQUAL 2 */

                            if (LXFPF990.REG_HEADER.RH_TIPO_ARQUIVO == 2)
                            {

                                /*" -2395- ADD 1 TO W-QTD-LH-TIPO-2 */
                                WAREA_AUXILIAR.W_QTD_LH_TIPO_2.Value = WAREA_AUXILIAR.W_QTD_LH_TIPO_2 + 1;

                                /*" -2396- GO TO R0050-00-LER-MOV-SIGAT */
                                new Task(() => R0050_00_LER_MOV_SIGAT_SECTION()).RunSynchronously(); //GOTO
                                return;//Recursividade detectada, cuidado...

                                /*" -2397- ELSE */
                            }
                            else
                            {


                                /*" -2398- IF RH-TIPO-ARQUIVO OF REG-HEADER EQUAL 3 */

                                if (LXFPF990.REG_HEADER.RH_TIPO_ARQUIVO == 3)
                                {

                                    /*" -2399- ADD 1 TO W-QTD-LH-TIPO-3 */
                                    WAREA_AUXILIAR.W_QTD_LH_TIPO_3.Value = WAREA_AUXILIAR.W_QTD_LH_TIPO_3 + 1;

                                    /*" -2400- GO TO R0050-00-LER-MOV-SIGAT */
                                    new Task(() => R0050_00_LER_MOV_SIGAT_SECTION()).RunSynchronously(); //GOTO
                                    return;//Recursividade detectada, cuidado...

                                    /*" -2401- ELSE */
                                }
                                else
                                {


                                    /*" -2403- IF RH-TIPO-ARQUIVO OF REG-HEADER NOT EQUAL 1 AND RH-TIPO-ARQUIVO OF REG-HEADER NOT EQUAL 0 */

                                    if (LXFPF990.REG_HEADER.RH_TIPO_ARQUIVO != 1 && LXFPF990.REG_HEADER.RH_TIPO_ARQUIVO != 0)
                                    {

                                        /*" -2405- IF RH-NOME OF REG-HEADER NOT EQUAL 'PRPSASSE' AND RH-NOME OF REG-HEADER NOT EQUAL 'SEGINFDB' */

                                        if (LXFPF990.REG_HEADER.RH_NOME != "PRPSASSE" && LXFPF990.REG_HEADER.RH_NOME != "SEGINFDB")
                                        {

                                            /*" -2406- GO TO R0050-00-LER-MOV-SIGAT */
                                            new Task(() => R0050_00_LER_MOV_SIGAT_SECTION()).RunSynchronously(); //GOTO
                                            return;//Recursividade detectada, cuidado...

                                            /*" -2408- ELSE */
                                        }
                                        else
                                        {


                                            /*" -2409- DISPLAY 'PF0600B - FIM ANORMAL' */
                                            _.Display($"PF0600B - FIM ANORMAL");

                                            /*" -2411- DISPLAY '          TIPO ARQUIVO INVALIDO ' RH-TIPO-ARQUIVO OF REG-HEADER */
                                            _.Display($"          TIPO ARQUIVO INVALIDO {LXFPF990.REG_HEADER.RH_TIPO_ARQUIVO}");

                                            /*" -2412- PERFORM R9988-00-FECHAR-ARQUIVOS */

                                            R9988_00_FECHAR_ARQUIVOS_SECTION();

                                            /*" -2415- PERFORM R9999-00-FINALIZAR. */

                                            R9999_00_FINALIZAR_SECTION();
                                        }

                                    }

                                }

                            }

                        }

                    }

                }

            }


            /*" -2416- IF W-FIM-MOVTO-SIGAT NOT EQUAL 'FIM' */

            if (WAREA_AUXILIAR.W_FIM_MOVTO_SIGAT != "FIM")
            {

                /*" -2418- IF RH-NOME OF REG-HEADER NOT EQUAL 'PRPSASSE' AND RH-NOME OF REG-HEADER NOT EQUAL 'SEGINFDB' */

                if (LXFPF990.REG_HEADER.RH_NOME != "PRPSASSE" && LXFPF990.REG_HEADER.RH_NOME != "SEGINFDB")
